import React from 'react';
import styled from 'styled-components';

const StyledWrapper = styled.div`
  width: 100%;
  background-color: ${({ theme }) => theme.blue};
`;

const Post = ({ author, content, created }) => (
  <StyledWrapper>
    <p>{author}</p>
    <p>{content}</p>
    <p>{created}</p>
  </StyledWrapper>
);

export default Post;
